import { ref } from "vue";

export function useComposableTest(inputValue = 0) {
    const testCount = ref(inputValue);

    const incrementCount = () => {
        this.testCount++;
    }

    const reduceCount = () => {
        this.testCount--;
    }

    const doubleCount = () => {
        this.testCount *= 2;
    }

    const halfCount = () => {
        this.testCount /= 2;
    }

    return {
        testCount,
        incrementCount,
        reduceCount,
        doubleCount,
        halfCount
    };
}
